The very first OO7

The screen debut of James Bond 007, broadcast live on CBS television in the U.S. on October 21, 1954 as part of the &quot;Climax Mystery Theater.&quot;

Running time: 50 minutes.

Starring Barry Nelson as Jimmy Bond, Linda Christian as the Bond girl, Peter Lorre as the villain, Le Chiffre, with Michael Pate as Clarence Leiter.
